var tipuesearch = {"pages": [{'title': 'About', 'text': 'About me \n 👉 major in : NFU-MDE(國立虎尾科技大學-機械設計工程系)\xa0 \n 👉 my\xa0repository\xa0:  40823139 / Leon-site \n 該網頁為暫時性歷程網站，基於 mdecycu/cmsimde 為引擎建立 \n Other pages \n \n 計算機程式 \xa0: 關於本網頁建立之基礎 \n 網際內容管理  : 認知網頁基礎理論與使用 \n \n \n \n \n \n \n \n \n  分隔線  \n \n \n Please enable JavaScript to view the  comments powered by Disqus.', 'tags': '', 'url': 'About.html'}, {'title': 'Motivation', 'text': '我來自國立虎尾科技大學機械設計工程系，在校學習期間，我深有感觸其近年機械領域不再是單純以機構設計、應力分析等為主要研究方向，除了機電整合外，更呈現出機電資整合的趨勢! \n 由於家鄉位於台南，在近15年來，產業趨勢的變化如同蠻悍的無形巨手推動著我，使我認知學其廣是遠遠不夠的，更加重要的是精。其專題與比賽經歷也更使我更加確定了我未來志向，後續將以機電領域為研究方向。 \n 興趣領域: 機器人、影像技術、系統晶片 \n', 'tags': '', 'url': 'Motivation.html'}, {'title': 'Study Plan', 'text': '\n 近期 ( 入學前 ) \n \n 強化理論能力  :  當前理論能力明顯不足，因此在入學前會加強機電領域相關基本理論與影像技術等研究領域知識。 \n 強化程式能力 : 對於本領域而言，coding能力佔了研究工具中非常大的成分，因次將在此階段加強軟韌方面撰寫及優化能力(並且特別針對C系列語言)，增加Leetcode次數，並多加瀏覽前輩的github \n 強化語文能力  :  閱讀相關理論或 paper 時，語文能力將影響整體的吸收速度，因此將在此階段加強專業英文與商用英文 \n \n \n 中期 ( 就讀期間 ) \n \n 深入了解研究領域問題  :  在擁有扎實的基礎之下，搞清處「為何解決該問題、如何解決該問題、解決該問題帶來什麼好處」後，開始深入專項研究領域 \n 多方參與  :  多多參與競賽及計畫強化實務與社交能力，並藉由多方交流提升溝通的精準能力 \n \n \n', 'tags': '', 'url': 'Study Plan.html'}, {'title': '專題', 'text': '本研究大綱 \n 本研究利用自帶機械視覺裝置的協作型機器手臂 TM5-900 ，利用鏡頭掃描 QRcode 的方式呼叫出相對應流程之專案進行上下料，利用手臂自帶視覺裝置的優勢，降低大量使用 HMI 人機介面及傳統機械按鈕的維護成本。下方附件為完整專題研究內容 \n 最終成果: 優勝 \n 👉 QR code機械手臂物料辨識與上下料 \xa0👈click here \n 指導教授: 林明宗教授、黃社振教授 \n 中文關鍵字:六軸機械手臂、機械視覺、二維碼、智慧製造 \n \n \n', 'tags': '', 'url': '專題.html'}, {'title': '修課歷程', 'text': '大學四年，除了理論性質的力學與工數外，也學習到了設計與製造。但對我而言，更加重要的是這期間的訓練幫我建立起一種思辨模式，便是開始思考「目的是什麼」、「解決了哪些問題」，不再是單純「有錯就除，沒問題就行」，也理解到何謂協同，同步、異步的分配與版本管理的重要性。 \n 期間，我也理會到理論的重要性，究竟是會用工具罷了，還是真的懂呢。而這點在碩士課程中的數位訊號處理也深有體悟，「原來傅立葉這麼好用!在影像、音訊、濾波等等這些都會用到，才不是單純工數拿來考試，而是拿來用的」，以上，便是我在修業期間最重要的感悟。 \n', 'tags': '', 'url': '修課歷程.html'}, {'title': '全國競賽', 'text': '', 'tags': '', 'url': '全國競賽.html'}, {'title': '2022全國智慧製造應用競賽', 'text': '本研究利用自帶機械視覺裝置的協作型機器手臂 TM5-900 ，並利用鏡頭掃描 Landmark( 達明開發之視覺座標系標定物 ) 後，由機械視覺產生出虛擬座標，再經由通訊將機器人軟體 RoboDK 產生之加工路徑匯入達明手臂控制系統，座標系校正後進行 3D 曲線輪廓塗膠。 \n 最終成果: 第四名 \n \n', 'tags': '', 'url': '2022全國智慧製造應用競賽.html'}, {'title': '測試用網頁', 'text': '測試用網頁，非實際展示網頁 \n', 'tags': '', 'url': '測試用網頁.html'}]};